import React from "react";

import '../Css/ListaChat.css';

function ListaChat() {
  return(
    <div
    className='chat'>
        <div className="ChatN1">
          <input placeholder="ESCRIBE LO QUE QUIERAS"/>
          <button>Enviar</button>
        </div>
        <div className="ChatN2">
          <input placeholder="ESCRIBE LO QUE QUIERAS"/>
          <button>Enviar</button>
        </div>
      <div className="RegistroChat">
        REGISTRO DEL CHAT
      </div>
    </div>
  )
};

export default ListaChat;
